import React, {Component} from 'react';
import '../CSS/AddWindow.css';

class AddWindow extends Component {
    saveMeds() {

    }

    render() {
        return(
            <div>
                <div className='dim-background' onClick={this.props.toggle}></div>
                <div className='add-window'>
                    <div className="top"><p>Add new medication</p></div>
                    <input type="text" ref="name-input" placeholder="Name"></input>
                    <input type="text" ref="amount-input" placeholder="Amount"></input>
                    <button className="save" onClick={() => {
                        this.props.toggle();
                        this.saveMeds();
                    }}>Save</button>
                </div>
            </div>
        )
    }
}

export default AddWindow;
